- input: "TEXT\x1CC00525899\x1C.TEXT\x1C\x1CF3XA\x1CWe have amended the 2012 October
    Quarterly Report in response to the April 2, 2013 RFAI letter that we received
    regarding 24 hour IE Reports filed by our committee during the reporting period
    and subsequent entries detailed on Schedule E, supporting Line 24. In response
    to point 1 of the letter; we incorrectly included payments made for regular PAC
    administrative expenses to American Airlines, Chick-fil-A, Chipotle, CVS, Five,
    Hard Times, Jimmy John's, Motel 6, Pizza Boli's, Rein Tong Thai, Trader Joe's,
    Boston Market, Subway and Lime Fresh Mexican Grill as independent expenditures
    on our 24 Hour Reports filed from 8/1/12 to 8/13/12.  We received additional information
    from the FEC and adjusted our 24 hour IE reporting to only include those expenditures
    that met the definition of an independent expenditure.  In addition, we have added
    additional itemized disbursements on Schedule E for Line 24 for the expenditures
    made to 'CAV call agent salary' and 'NorthStar Campaign Systems' so that they
    now correlate to the 24 hour reports filed by the Committee.  Please also note
    that the independent expenditures originally disclosed to 'CAV full-time staff'
    for Grantham and Schweikert are now showing with 'Edward King' as the updated
    payee.\n"
